def calculate_travel_ways(n, c, planet_data):

    def check(a, b, tar, x):
        ans = 0
        for i in range(len(a)):
            ans += a[i] * x // b[i]
        if ans == tar:
            return 0
        elif ans > tar:
            return 1
        else:
            return -1
    a = [data[0] for data in planet_data]
    b = [data[1] for data in planet_data]
    if not sum(a):
        return -1 if c == n else 0
    if c <= n:
        return 0
    (val, tar, lo, hi, maxi, mini) = (-1, c - n, 1, 10 ** 18, 10 ** 20, 1)
    while hi >= lo:
        x = (hi + lo) // 2
        y = check(a, b, tar, x)
        if not y:
            val = x
            break
        elif y == 1:
            hi = x - 1
        else:
            lo = x + 1
    if val == -1:
        return 0
    for i in range(n):
        if not a[i]:
            continue
        zz = a[i] * val // b[i] * b[i]
        mini = max(mini, zz // a[i] + (zz % a[i] != 0))
        zz += b[i]
        maxi = min(maxi, zz // a[i] + (zz % a[i] != 0))
    return maxi - mini

